import './RateNotification.css';
import { hasActions } from '../../../../../helpers/notification-utils';
import { BasePushMessage } from '../../../../../schemas/basePushMessageSchema';
import AndroidPhoneBackground from '../../../../shared/android-phone-background/AndroidPhoneBackground';
import NavigationBar from '../navigation-bar/NavigationBar';

interface RateNotificationProps {
  notification: Extract<BasePushMessage, { type: 're.notifica.notification.Rate' }>;
  appName: string;
}

export default function RateNotification(props: RateNotificationProps) {
  const { notification, appName } = props;

  return (
    <AndroidPhoneBackground theme="light">
      <NavigationBar
        appName={appName}
        title={notification.title}
        hasActions={hasActions(notification)}
      />
      <img
        className="notificare__android-app-push-ui-rate-rich-content"
        alt="Play Store's Notificare Go installation page"
        src="data:image/png;base64,"
      />
    </AndroidPhoneBackground>
  );
}
